import React from "react";


import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import { Nav,Navbar } from 'react-bootstrap';

import Home from '../Home/home';
import About from '../About/about';
import Contact from '../Contact/contact';
import Login from '../Login/login';
import './menu.css';
import Cometa from '../Imagem/cometa.png';

export default function Menu() {
  return (
    <Router>
      <div>
      <Navbar collapseOnSelect expand="lg" bg="dark" variant="dark">
      <img 
        src={Cometa}
        alt="Viação Cometa"
        width="200"
        height="50"
        className="d-inline-block align-top"
        />
          <Navbar.Brand>Viação Cometa</Navbar.Brand>
          <Navbar.Toggle aria-controls="responsive-navbar-nav" />
          <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="mr-auto">
              <Link to="/" className="a">Inicio</Link>
              <Link to="/Contact" className="a">Contatos</Link>
              <Link to="/about" className="a">Sobre</Link>
              <Link to="/" className="a">Sobre</Link>
            </Nav>
          </Navbar.Collapse>
        </Navbar>
        
        <Switch>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/contact">
            < Contact/>
          </Route>
          <Route path="/">
            <Home />
          </Route>
          <Route path="/login">
            <Login />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}
